import React, { useEffect, useState } from "react";

const Lab1AResults1Display: React.FC = () => {
  const [results, setResults] = useState<any>(null);

  useEffect(() => {
    const storedResult = localStorage.getItem('lab1a_1_result');
    if (storedResult) {
      setResults(JSON.parse(storedResult));
    }
  }, []);

  const renderValue = (value: { val: number, is_right: boolean }) => {
    return (
      <span style={{ color: value.is_right ? "green" : "red" }}>
        {value.val}
      </span>
    );
  };

  if (!results) {
    return <div>Загрузка данных...</div>;
  }

  const { result } = results;

  return (
    <div>
      <h3>Ответы на текущий этап</h3>
      <div>
        <h4>Массив X:</h4>
        <ul>
          {result.x.map((item: { val: number, is_right: boolean }, index: number) => (
            <li key={index}>
              {`X[${index + 1}]: `}
              {renderValue(item)}
            </li>
          ))}
        </ul>
      </div>

      <div>
        <h4>Массив W:</h4>
        <ul>
          {result.w.map((item: { val: number, is_right: boolean }, index: number) => (
            <li key={index}>
              {`W[${index + 1}]: `}
              {renderValue(item)}
            </li>
          ))}
        </ul>
      </div>

      <div>
        <h4>Массив M * W:</h4>
        <ul>
          {result.mw.map((item: { val: number, is_right: boolean }, index: number) => (
            <li key={index}>
              {`M * W[${index + 1}]: `}
              {renderValue(item)}
            </li>
          ))}
        </ul>
      </div>

      <div>
        <h4>Массив λ * W:</h4>
        <ul>
          {result.lambda_w.map((item: { val: number, is_right: boolean }, index: number) => (
            <li key={index}>
              {`λ * W[${index + 1}]: `}
              {renderValue(item)}
            </li>
          ))}
        </ul>
      </div>

      <div>
        <h4>λmax:</h4>
        {renderValue(result.lambda_max)}
      </div>

      <div>
        <h4>ИС:</h4>
        {renderValue(result.is)}
      </div>

      <div>
        <h4>ОС:</h4>
        {renderValue(result.os)}
      </div>
    </div>
  );
};

export default Lab1AResults1Display;
